void mainImage( out vec4 fragColor, in vec2 fragCoord )
{
    vec2 uv = fragCoord/iResolution.y;
    float f = 50.0;
    float t = iTime * .150;
    float e = 0.123;
    float i = 7.7123;
    float d = length(uv-0.5);
    e*=sin( d * 2.7);
    if(uv.x>0.2 && uv.x < 0.8 && uv.y < 0.8 && uv.y > 0.2 ){
        uv*=-1.0;
        i+=2.1;
        e*=-1.;
        t+=1.23;
    }
    uv.x += t + sin(uv.y*i)*e;
    uv.y += t - cos(uv.x*i)*e;
    float g = 50.0;
    float k =  0.0;  
    k-= cos(sin(uv.y*7.12)*g) *10.0;    
    k+= tan(sin(uv.y*2.22)*g*0.1) *7.0;    
    k+= sin(uv.y*t*.1);
    fragColor = vec4(k);
}
